import React from 'react'
import CourierLogo from '../images/courier.png';
import "../css/Home.css"

const Home = () => {
  return (
    <div className="Home">
      <img src={CourierLogo} alt="Courier-Logo" />
      <div className="Home-title">
        <h1>BantuKurir</h1>
      </div>
    </div>
  )
}

export default Home
